sys_script_include.script:
var DXCObsidianDocumentUtilsAJAX = Class.create();
DXCObsidianDocumentUtilsAJAX.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {

	startSupplierFeedbackFlow: function() {

		var feedback = this.getParameter("sysparm_feedback");
		var library_record = this.getParameter("sysparm_library");
		var library_GR = new GlideRecord('x_nesa_ng_obsidian_document');
		if(library_GR.get(library_record)) {
			return new x_nesa_ng_obsidian.DXCObsidianDocumentUtils().startSupplierFeedbackFlow(library_GR, feedback);
		}
	},
	type: 'DXCObsidianDocumentUtilsAJAX'
});
